   const params={
          method:'post',
          headers:{
            'Content-Type':'application/json'
          },
          body:JSON.stringify(data1),
    }
    fetch(url,params).then(response=>response.json()).then(data1=>console.log(data1));
    fetch(url).then(response=>response.json()).then(setData(data))
    return(
        <>
        <table>
            <tr>
                <th>ID</th>
                <th>TITLE</th>
                <th>BODY</th>
            </tr>
                <>
                {
                data.map((filtered)=>
